import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import {useSelector} from 'react-redux';

class Home extends Component {
    username = useSelector((state) => state.loginReducer)
    constructor(props) {
        super(props);
    }

    render() {
        return <div>
            <h3>Home Page = {this.username}</h3>
        </div>
    }
}

export default Home;
